import React, { Component } from 'react';
import {Row,Col} from 'react-bootstrap';
export default class Bangladesh extends Component {
  render() {
    return (
        <div> 
            <Row>
                <Col sm={8}>sm=8</Col>
                <Col sm={4}>sm=4</Col>
            </Row>
        </div>
    );
  }
}
